INSERT INTO `article` VALUES ('26', '与南昌同仁堂合作，为其设计开发官方APP——同仁堂', '同仁堂是全国中药行业著名的老字号。创建于1669年（清康熙八年），自1723年开始供奉御药，历经八代皇帝188年。在300多年的风雨历程中，历代同仁堂人始终恪守&quot;炮制虽繁必不敢省人工，品味虽贵必不敢减物力&quot;的古训，树立&quot;修合无人见，存心有天知&quot;的自律意识，造就了制药过程中兢兢小心、精益求精的严细精神，其产品以&quot;配方独特、选料上乘、工艺精湛、疗效显著&quot;而享誉海内外', '<p>\r\n	<span style=\"font-size:14px;line-height:2;\">同仁堂是全国中药行业著名的老字号。创建于</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">1669</span><span style=\"font-size:14px;line-height:2;\">年（清康熙八年），自</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">1723</span><span style=\"font-size:14px;line-height:2;\">年开始供奉御药，历经八代皇帝</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">188</span><span style=\"font-size:14px;line-height:2;\">年。在</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">300</span><span style=\"font-size:14px;line-height:2;\">多年的风雨历程中，历代同仁堂人始终恪守</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">\"</span><span style=\"font-size:14px;line-height:2;\">炮制虽繁必不敢省人工，品味虽贵必不敢减物力</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">\"</span><span style=\"font-size:14px;line-height:2;\">的古训，树立</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">\"</span><span style=\"font-size:14px;line-height:2;\">修合无人见，存心有天知</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">\"</span><span style=\"font-size:14px;line-height:2;\">的自律意识，造就了制药过程中兢兢小心、精益求精的严细精神，其产品以</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">\"</span><span style=\"font-size:14px;line-height:2;\">配方独特、选料上乘、工艺精湛、疗效显著</span><span lang=\"EN-US\" style=\"font-size:14px;line-height:2;\">\"</span><span style=\"font-size:14px;line-height:2;\">而享誉海内外</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;line-height:11pt;\">\r\n	<span style=\"font-size:14px;line-height:2;\"><img src=\"/upload/editor/1508/20150817161521_40637.png\" alt=\"\" />\r\n</span> \r\n</p>', '16', '52', '2015-01-29 11:41:57', '辰锦科技', '本站原创', '/upload/article/1503/201503301403237254.jpg', '0', '', '0', '24');
INSERT INTO `article` VALUES ('27', '南昌市果优佳进口水果超市手机网站设计与开发', '南昌果优佳是目前南昌最大的进口水果网站之一。果优加是专注于水果进口，买卖，而且提供在线订购。我们帮其制作了手机网站，可以使其更好的让顾客方便、便捷的购买到自己喜爱的水果，做到真正的足不出户。', '<p>\r\n	南昌果优佳是目前南昌最大的进口水果网站之一。果优加是专注于水果进口，买卖，而且提供在线订购。我们帮其制作了手机网站，可以使其更好的让顾客方便、便捷的购买到自己喜爱的水果，做到真正的足不出户。\r\n</p>\r\n<p>\r\n	<img src=\"/upload/editor/1508/20150817161556_48098.png\" alt=\"\" />\r\n</p>', '16', '29', '2015-01-29 11:43:06', '辰锦科技', '本站原创', '/upload/article/1503/201503301403021788.jpg', '0', '', '0', '19');
INSERT INTO `article` VALUES ('28', '与家家有合作，为其设计开发移动客户端——经销商在线', '为中国移动江西地区及全国经销商提供业务交流、终端发布、信息资讯、休闲娱乐的综合平台。具有鲜明的行业风格，属全国首创。运营商、手机批发商、经销商、通讯从业人员通过这一平台实现无距离接触。信息共享，互惠互利。', '<p>\r\n	为中国移动江西地区及全国经销商提供业务交流、终端发布、信息资讯、休闲娱乐的综合平台。具有鲜明的行业风格，属全国首创。运营商、手机批发商、经销商、通讯从业人员通过这一平台实现无距离接触。信息共享，互惠互利。\r\n</p>\r\n<p>\r\n	<img src=\"/upload/editor/1508/20150817161659_90013.png\" alt=\"\" />\r\n</p>', '16', '17', '2015-01-29 11:49:06', '辰锦科技', '本站原创', '/upload/article/1503/201503301401433992.jpg', '0', '', '0', '15');
INSERT INTO `article` VALUES ('29', '与双胞胎集团合作，为其设计开发手机网站！', '双胞胎集团是一家集饲料研发、生产、销售与技术咨询为一体的大型饲料集团，总部设在江西省南昌市。集团荣获“中国名牌产品”、“国家免检产品”、“全国三十强饲料企业”、“国家农业产业化龙头企业”等诸多殊荣。', '<p>\r\n	双胞胎集团是一家集饲料研发、生产、销售与技术咨询为一体的大型饲料集团，总部设在江西省南昌市。集团荣获“中国名牌产品”、“国家免检产品”、“全国三十强饲料企业”、“国家农业产业化龙头企业”等诸多殊荣。\r\n</p>\r\n<p>\r\n	<img src=\"/upload/editor/1508/20150817161738_32987.png\" alt=\"\" />\r\n</p>', '16', '20', '2015-01-29 11:49:56', '辰锦科技', '本站原创', '/upload/article/1503/201503301400003683.jpg', '0', '', '0', '22');
INSERT INTO `article` VALUES ('30', '为师范大学设计开发新闻资讯类APP——I看师大', '江西师范大学第一个也是唯一一个专业校园摄影杂志，由师生采写，反映师生生活，向师生传播，以摄影为主要观察和表现方式，多维、深度、专注地反映江西师范大学深厚人文和美好生态，引导师生热爱校园热爱生活，是在校师生、离校校友、社会人士关注师大必备的掌上新媒体。', '江西师范大学第一个也是唯一一个专业校园摄影杂志，由师生采写，反映师生生活，向师生传播，以摄影为主要观察和表现方式，多维、深度、专注地反映江西师范大学深厚人文和美好生态，引导师生热爱校园热爱生活，是在校师生、离校校友、社会人士关注师大必备的掌上新媒体。<br />\r\n<img src=\"/upload/editor/1508/20150817161804_43972.png\" alt=\"\" />', '16', '15', '2015-01-29 11:51:25', '辰锦科技', '本站原创', '/upload/article/1503/201503301358438951.jpg', '0', '', '0', '17');
INSERT INTO `article` VALUES ('31', '为妆点科技设计开发电商类APP——碰爱商城', '妆点网（现隶属妆点科技旗下网络媒体平台）成立于2007年5月，是目前中国最大的互联网女性垂直门户网站之一。妆点是专注于向年轻时尚的女性群体提供包括无线互联网信息、网络广告以及女性商品在线订购的综合服务提供商。先后荣获“国内十佳购物网站”、“最受女性喜爱的门户网站”、“中国优秀女性传媒” “优秀区域垂直门户”“中国创新电子商务服务品牌”等称号。我们帮其制作了碰爱手机APP客户端', '妆点网（现隶属妆点科技旗下网络媒体平台）成立于2007年5月，是目前中国最大的互联网女性垂直门户网站之一。妆点是专注于向年轻时尚的女性群体提供包括无线互联网信息、网络广告以及女性商品在线订购的综合服务提供商。先后荣获“国内十佳购物网站”、“最受女性喜爱的门户网站”、“中国优秀女性传媒” “优秀区域垂直门户”“中国创新电子商务服务品牌”等称号。我们帮其制作了碰爱手机APP客户端<br />\r\n<img src=\"/upload/editor/1508/20150817161843_13960.png\" alt=\"\" />', '16', '1269', '2015-01-29 11:59:25', '辰锦科技', '本站原创', '/upload/article/1503/201503301357286894.jpg', '0', '', '0', '21');
INSERT INTO `article` VALUES ('33', '为财大集团设计开发电商类APP——财购', '财购网提倡诚信、活跃、快速的网络交易文化，”在为财购会员打造更安全高效的网络交易平台的同时，财购网也全力营造和倡导互帮互助、轻松活泼的家庭式氛围。每位在财购网进行交易的人，不但交易更迅速高效，而且交到更多朋友。2005年10月，财购网宣布：在未来5年，为社会创造100万工作的机会，帮助更多网民在财购网上就业，甚至于创业。', '财购网提倡诚信、活跃、快速的网络交易文化，”在为财购会员打造更安全高效的网络交易平台的同时，财购网也全力营造和倡导互帮互助、轻松活泼的家庭式氛围。每位在财购网进行交易的人，不但交易更迅速高效，而且交到更多朋友。2005年10月，财购网宣布：在未来5年，为社会创造100万工作的机会，帮助更多网民在财购网上就业，甚至于创业。<br />\r\n<img src=\"/upload/editor/1508/20150817161953_49530.png\" alt=\"\" />', '16', '1018', '2015-01-29 12:00:09', '辰锦科技', '本站原创', '/upload/article/1503/201503301355186648.jpg', '0', '', '0', '10');
INSERT INTO `article` VALUES ('34', '活动群组类APP——JOJO', 'JOJO的核心用户群是具有良好教育背景的都市青年，包括白领及大学生。他们热爱生活，除了阅读、看电影、听音乐，更活跃于豆瓣小组、小站，对吃、穿、住、用、行等进行热烈的讨论。他们热衷参与各种有趣的线上、线下活动，拥有各种鬼马创意，是互联网上流行风尚的发起者和推动者。JOJO已渐渐成为他们生活中不可缺少的一部分。', 'JOJO的核心用户群是具有良好教育背景的都市青年，包括白领及大学生。他们热爱生活，除了阅读、看电影、听音乐，更活跃于豆瓣小组、小站，对吃、穿、住、用、行等进行热烈的讨论。他们热衷参与各种有趣的线上、线下活动，拥有各种鬼马创意，是互联网上流行风尚的发起者和推动者。JOJO已渐渐成为他们生活中不可缺少的一部分。<br />\r\n<img src=\"/upload/editor/1508/20150817162030_90974.png\" alt=\"\" />', '16', '1045', '2015-01-29 12:00:29', '辰锦科技', '本站原创', '/upload/article/1503/201503301354155638.jpg', '0', '', '0', '16');
INSERT INTO `article` VALUES ('35', '为齐聚网络科技设计开发社交类APP——邀喝', '邀喝客户端这是一款定位将陌生人喝酒、品茶、咖啡、饭局从线上约到线下交流的社区应用，此产品还汇聚本地优质供约会对象来选择，商家最新活动资讯也将实时在线发布，我们帮其制作手机客户端APP.', '邀喝客户端这是一款定位将陌生人喝酒、品茶、咖啡、饭局从线上约到线下交流的社区应用，此产品还汇聚本地优质供约会对象来选择，商家最新活动资讯也将实时在线发布，我们帮其制作手机客户端APP.<br />\r\n<img src=\"/upload/editor/1508/20150817161442_42048.png\" alt=\"\" />', '16', '1027', '2015-01-29 12:00:44', '辰锦科技', '本站原创', '/upload/article/1503/201503301353203233.jpg', '0', '', '0', '14');
INSERT INTO `article` VALUES ('36', '关于', '辰锦科技成立于2012年，是由一群专业、独特的IT精英组成的团队。一直以来辰锦科技紧贴网络时代的发展潮流，对中国网络应用的现状和趋势有很深的认识。这几年的发展探索中，公司秉持&quot;拒绝平凡&quot;的理念，致力于产品体验领域，提供视觉创意设计、移动客户端开发、网站开发及HTML5开发等服务。', '辰锦科技成立于2012年，是由一群专业、独特的IT精英组成的团队。一直以来辰锦科技紧贴网络时代的发展潮流，对中国网络应用的现状和趋势有很深的认识。<span style=\"white-space:normal;\">这几年的发展探索中，公司秉持\"拒绝平凡\"的理念，致力于产品体验领域，提供视觉创意设计、移动客户端开发、网站开发及HTML5开发等服务。</span>', '18', '0', '2015-01-29 16:50:36', '辰锦科技', '本站原创', '/upload/article/1503/201503271417238090.jpg', '0', '', '0', '0');
INSERT INTO `article` VALUES ('37', '流程', '经过这几年不断的探索，目前已形成一套科学、完整、高效的设计开发运作体系，凭借高品味的设计风格、精湛严密的制作工艺，为不同客户提供不同风格的产品服务。\r\n我们的合作流程：客户的需求确定——精品创意设计——程序严密开发——严格测试——产品上线', '经过这几年不断的探索，目前已形成一套科学、完整、高效的设计开发运作体系，凭借高品味的设计风格、精湛严密的制作工艺，为不同客户提供不同风格的产品服务。<br />\r\n项目开发流程：客户的需求确定——精品创意设计——程序严密开发——严格测试——产品上线<br />', '18', '0', '2015-01-29 16:50:44', '辰锦科技', '本站原创', '/upload/article/1503/201503271105135446.jpg', '0', '', '0', '0');
INSERT INTO `article` VALUES ('38', '优势', '我们崇尚科技改变生活的理念，将自身所吸收的互联网产品知识与客户的需求相结合打造出客户需求的能为大众服务的产品。目前公司已经与万达集团、南昌林业局、新浪江西、同仁堂等等进行了深入的合作。因此不论你是需要资讯、企业小型类的APP，还是社交、电商大型类的APP，我们都有相应解决的方法。', '<span style=\"white-space:normal;\">我们崇尚科技改变生活的理念，将自身所吸收的互联网产品知识与客户的需求相结合打造出客户需求的能为大众服务的产品。目前公司已经与万达集团、南昌林业局、新浪江西、同仁堂等等进行了深入的合作。因此不论你是需要资讯、企业小型类的APP，还是社交、电商大型类的APP，我们都有相应解决的方法。</span><br />', '18', '0', '2015-01-29 16:50:52', '辰锦科技', '本站原创', '/upload/article/1502/201502261817326476.jpg', '0', '', '0', '0');
INSERT INTO `article` VALUES ('39', '关于辰锦', '辰锦科技成立于2012年，是由一群专业、独特的IT精英组成的团队。公司秉持&quot;拒绝平凡&quot;的理念，致力于产品体验领域，提供视觉创意设计、移动客户端开发、网站开发及HTML5开发等服务。经过这几年不断的探索，目前已形成一套科学、完整、高效的设计开发运作体系，凭借高品味的设计风格、精湛严密的制作工艺，为不同客户提供不同风格的产品服务。 ', '辰锦科技成立于2012年，是由一群专业、独特的IT精英组成的团队。公司秉持\"拒绝平凡\"的理念，致力于产品体验领域，提供视觉创意设计、移动客户端开发、网站开发及HTML5开发等服务。经过这几年不断的探索，目前已形成一套科学、完整、高效的设计开发运作体系，凭借高品味的设计风格、精湛严密的制作工艺，为不同客户提供不同风格的产品服务。&nbsp;', '17', '0', '2015-01-29 16:55:42', '辰锦科技', '本站原创', '/upload/article/1502/201502271726297327.jpg', '0', '', '0', '0');
INSERT INTO `article` VALUES ('40', '我们的优势', '我们的优势在于我们重视于每一份业务的质量。提升客户品牌形象是我们致力追求的目标，崇尚科技改变生活的理念，将自身所吸收的互联网产品知识与客户的需求相结合打造出客户需求的能为大众服务的产品。一直以来辰锦科技紧贴网络时代的发展潮流，对中国网络应用的现状和趋势有很深的认识，因此不论你是需要资讯、企业小型类的APP，还是社交、电商大型类的APP，我们都有相应解决的方法。目前公司已经与南昌万达集团、南昌林业局、新浪江西、南昌同仁堂、双胞胎集团、财大集团等等进行了深入的合作。​', '我们的优势在于我们重视于每一份业务的质量。提升客户品牌形象是我们致力追求的目标，崇尚科技改变生活的理念，将自身所吸收的互联网产品知识与客户的需求相结合打造出客户需求的能为大众服务的产品。一直以来辰锦科技紧贴网络时代的发展潮流，对中国网络应用的现状和趋势有很深的认识，因此不论你是需要资讯、企业小型类的APP，还是社交、电商大型类的APP，我们都有相应解决的方法。<span style=\"display:none;\" id=\"__kindeditor_bookmark_start_6__\"></span>目前公司已经与南昌万达集团、南昌林业局、新浪江西、南昌同仁堂、双胞胎集团、财大集团等等进行了深入的合作。<span style=\"display:none;\" id=\"__kindeditor_bookmark_end_7__\"></span>', '17', '0', '2015-01-29 16:55:53', '辰锦科技', '本站原创', '/upload/article/1502/201502041753015303.jpg', '0', '', '0', '0');
INSERT INTO `article` VALUES ('42', '为上海行翼网络科技公司设计开发社交类APP——友趣', '友趣是一款基于地理位置的移动社交工具。使用者可以通过友趣认识附近的人，免费发送文字消息、语音、照片以及精准的地理位置和身边的人更好的交流；可以使用友趣创建和加入附近的兴趣小组、留言\r\n及附近活动和，丰富自己的朋友圈。通过友趣可以更加便捷的通过地理位置信息，发现附近的人，更加便捷的与人进行即时的互动，降低了社交门槛，加强更加真实的互动。', '友趣是一款基于地理位置的移动社交工具。使用者可以通过友趣认识附近的人，免费发送文字消息、语音、照片以及精准的地理位置和身边的人更好的交流；可以使用友趣创建和加入附近的兴趣小组、留言及附近活动和，丰富自己的朋友圈。通过友趣可以更加便捷的通过地理位置信息，发现附近的人，更加便捷的与人进行即时的互动，降低了社交门槛，加强更加真实的互动。<br />\r\n<img src=\"/upload/editor/1508/20150817161417_83192.png\" alt=\"\" />', '16', '1128', '2015-02-27 15:32:13', '辰锦科技', '本站原创', '/upload/article/1503/201503301351403571.jpg', '0', '', '0', '9');
INSERT INTO `article` VALUES ('43', '南昌社交活动类APP——聚活动', '聚活动是由南昌市辰锦网络科技有限公司开发，新浪江西信息技术有限公司联合运营的一个品牌产品，集合了城市吃喝玩乐等各方面活动资讯。1、内容全面，活动更新快。2、快速查找到区域附近的活动。3、品牌馆商家筛选出优质活动，可直接在线报名参加活动。4、参加报名的用户可推送特定的活动提醒。\r\n', '聚活动是由南昌市辰锦网络科技有限公司开发，新浪江西信息技术有限公司联合运营的一个品牌产品，集合了城市吃喝玩乐等各方面活动资讯。1、内容全面，活动更新快。2、快速查找到区域附近的活动。3、品牌馆商家筛选出优质活动，可直接在线报名参加活动。4、参加报名的用户可推送特定的活动提醒。<br />\r\n\r\n	<img src=\"/upload/editor/1508/20150817161348_46327.png\" alt=\"\" />\r\n', '16', '1299', '2015-02-27 15:33:35', '辰锦科技', '本站原创', '/upload/article/1503/201503301350527620.jpg', '0', '', '0', '20');
INSERT INTO `article` VALUES ('44', '为新浪江西设计开发移动客户端——新浪陶瓷客', '新浪江西为满足大众对陶瓷艺术和陶瓷产品的需求，倾力打造江西省首个陶瓷电商的手机客户端——淘瓷客APP平台，通过该平台，景德镇众多大师以及大部分具有潜力的中青年艺术家的作品能够全方位、立体式向手机用户展示，同时景德镇千年的陶瓷艺术和全新创新也能随时随地供消费者查询，便于用户了解陶瓷行情，品味陶瓷文化，打造只属于自己的居家时尚风格。', '新浪江西为满足大众对陶瓷艺术和陶瓷产品的需求，倾力打造江西省首个陶瓷电商的手机客户端——淘瓷客APP平台，通过该平台，景德镇众多大师以及大部分具有潜力的中青年艺术家的作品能够全方位、立体式向手机用户展示，同时景德镇千年的陶瓷艺术和全新创新也能随时随地供消费者查询，便于用户了解陶瓷行情，品味陶瓷文化，打造只属于自己的居家时尚风格。<br />\r\n<img src=\"/upload/editor/1508/20150817161137_78128.png\" alt=\"\" />', '16', '1243', '2015-02-27 15:35:37', '辰锦科技', '本站原创', '/upload/article/1503/201503301349241157.jpg', '0', '', '0', '23');
INSERT INTO `article` VALUES ('45', '为编织小屋设计开发移动客户端', '编织圈-由编织小屋提供的大量编织新手入门的教程视频，让您简单上手进入编织的圈子。提供原创的毛衣、围巾、帽子、玩偶等成品的编织教程视频和图解，全部免费、不停更新！编织圈为你提供了更快速、漂亮、有趣的方式，记录和展现你热爱编织的一面，与志趣相投的朋友分享、交流。\r\n', '编织圈-由编织小屋提供的大量编织新手入门的教程视频，让您简单上手进入编织的圈子。提供原创的毛衣、围巾、帽子、玩偶等成品的编织教程视频和图解，全部免费、不停更新！编织圈为你提供了更快速、漂亮、有趣的方式，记录和展现你热爱编织的一面，与志趣相投的朋友分享、交流。<br />\r\n<br />\r\n<img src=\"/upload/editor/1508/20150817154445_46381.png\" alt=\"\" />', '16', '1219', '2015-02-28 12:53:19', '辰锦科技', '本站原创', '/upload/article/1503/201503301350136583.jpg', '0', '', '0', '18');
INSERT INTO `article` VALUES ('46', '设计开发行业资讯类APP——北京奶豆', '北京奶豆定位于IT技术手段促进中国畜牧业的信息化发展，以养牛为立足点，以提供高效精准的“全方位营销传播服务”为使命，致力于将最前沿IT技术以快速度应用于传统行业，使得传统行业与新技术紧密结合，秉承“科技，让营销更有力”的运营理念，打造中国最具有营销穿透力的企业', '<p>\r\n	北京奶豆定位于IT技术手段促进中国畜牧业的信息化发展，以养牛为立足点，以提供高效精准的“全方位营销传播服务”为使命，致力于将最前沿IT技术以快速度应用于传统行业，使得传统行业与新技术紧密结合，秉承“科技，让营销更有力”的运营理念，打造中国最具有营销穿透力的企业\r\n</p>\r\n<p>\r\n	<img src=\"/upload/editor/1508/20150815174411_86732.png\" alt=\"\" style=\"display:block;\" /> \r\n</p>', '16', '1407', '2015-02-28 12:56:36', '辰锦科技', '本站原创', '/upload/article/1503/201503301410418558.jpg', '0', '', '0', '13');
INSERT INTO `article` VALUES ('47', '青春路上，阳光正好！', '', '<p align=\"center\">\r\n	<img src=\"/upload/editor/1504/20150403163931_85252.png\" alt=\"\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '17', '0', '2015-03-27 20:30:26', '辰锦科技', '本站原创', '/upload/article/1503/201503301510523317.jpg', '0', '', '0', '0');
INSERT INTO `article` VALUES ('48', '为南昌86区开发其官方网站和手机微网站', '86区成立于2014年8月6日。是江西省内首家城市社区生活服务平台,为居民和商户搭建的在线交流互通的社交网络。网站提供社区便民服务、社交活动和生活百货等生活服务，同时提供旅游、汽车、金融、餐饮、文化等栏目，为社区生活提供全方位服务。', '86区成立于2014年8月6日。是江西省内首家城市社区生活服务平台,为居民和商户搭建的在线交流互通的社交网络。<br />\r\n<p>\r\n	网站提供社区便民服务、社交活动和生活百货等生活服务，同时提供旅游、汽车、金融、餐饮、文化等栏目，为社区生活提供全方位服务。\r\n</p>\r\n<p>\r\n	<img src=\"/upload/editor/1508/20150815172133_93405.png\" alt=\"\" />\r\n</p>', '16', '1553', '2015-07-22 09:47:03', '辰锦科技', '本站原创', '/upload/article/1507/201507220954053814.png', '0', '', '0', '28');
INSERT INTO `article` VALUES ('49', 'PHP开发工程师', '江西南昌', '<p style=\"white-space:normal;\">\r\n	<span style=\"line-height:2;\">职位职责</span><span style=\"line-height:2;\">：</span>\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<span style=\"color:#666666;line-height:2;\">1、精通PHP+MySQL，能够独立编写PHP应用程序；</span>\r\n</p>\r\n<span style=\"white-space:normal;color:#666666;\"><span style=\"line-height:2;\">2、熟悉TP框架,擅长各类PHP</span><span style=\"line-height:2;\">网站程序开发(有电</span></span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">商类开发经验) ， 熟练各开发和运行环境并有第</span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">三方接口开发经验；</span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">3、熟悉HTML、 JavaScript、CSS、XML等相关技</span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">术，熟悉Linux、Apache；</span><br style=\"white-space:normal;\" />\r\n<p style=\"white-space:normal;\">\r\n	<span style=\"line-height:2;\">职位要求：</span>&nbsp;\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<span style=\"color:#666666;line-height:2;\">1、专科以上学历，计算机软件等相关专业毕业，</span>\r\n</p>\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">1年以上开发工作经验；</span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">2、强烈的责任心和良好的团队合作精神，较好的</span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">沟通、协调能力；</span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">3、具有很强的分析问题和解决问题的能力,攻关疑</span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">难问题的强烈兴趣；</span><br style=\"white-space:normal;\" />\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\">4、善于学习。</span><br />', '19', '0', '2015-07-23 08:45:50', '辰锦科技', '本站原创', '/upload/article/1507/201507230845466602.jpg', '0', '', '4', '0');
INSERT INTO `article` VALUES ('50', 'UI设计师', '江西南昌', '<p style=\"white-space:normal;\">\r\n	<span style=\"line-height:2;\">职位职责：<br />\r\n<span style=\"color:#666666;\">1、 负责产品的设计定位，和用户体验设计师共同</span><br />\r\n<span style=\"color:#666666;\">设定产品的整体视觉风格；</span><br />\r\n<span style=\"color:#666666;\">2、 实现完整的视觉设计方案；&nbsp;</span><br />\r\n<span style=\"color:#666666;\">3、 相关说明文档的撰写等工作。</span><br />\r\n职位要求：<br />\r\n<span style=\"color:#666666;\">1、具有一定手机、网站等产品视觉设计的工作经</span><br />\r\n<span style=\"color:#666666;\">验，并提供相关作品；</span><br />\r\n<span style=\"color:#666666;\">2、认真细致，善于创新，对视觉设计、色彩有敏</span><br />\r\n<span style=\"color:#666666;\">锐的观察力及分析能力；</span><br />\r\n<span style=\"color:#666666;\">3、熟悉界面设计的方法和流程，善于沟通，拥有</span><br />\r\n<span style=\"color:#666666;\">非凡的创新与协作能力；</span><br />\r\n<span style=\"color:#666666;\">4、有较强时间管理能力，可以应对多个项目。</span><br />\r\n</span> \r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<span style=\"line-height:2;\"><span style=\"color:#666666;\">5、具有一定的产品思维；</span></span>\r\n</p>\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\"></span><br />', '19', '0', '2015-07-23 08:46:55', '辰锦科技', '本站原创', '/upload/article/1507/201507230846536547.jpg', '0', '', '3', '0');
INSERT INTO `article` VALUES ('51', '安卓开发工程师', '江西南昌', '<p style=\"white-space:normal;\">\r\n	<span style=\"line-height:2;\">职位职责：<br />\r\n<span style=\"color:#666666;\">1、</span><span style=\"color:#666666;\">APP客户端应用的独立开发;</span><br />\r\n<span style=\"color:#666666;\">2、完成应用模块的代码编写和测试;</span><br />\r\n<span style=\"color:#666666;\">3、负责代码的维护和改进工作;</span><br />\r\n职位要求：<br />\r\n<span style=\"color:#666666;\">1、具有Android软件开发经验1年以上，有独立作品；</span><br />\r\n<span style=\"color:#666666;\">2、熟练掌握Windows平台下的Android程序开发，熟练使用Eclipse开发工具，有相关开发经验者优先；</span><br />\r\n<span style=\"color:#666666;\">3、了解Android开发平台及框架原理，熟悉基于Android SDK的应用程序开发；</span><br />\r\n<span style=\"color:#666666;\">4、熟练应用SQL语言，熟练运用MySQL，SQLlite等数据库</span><br />\r\n<span style=\"color:#666666;\">5、具有很强的分析和沟通能力，较强的责任心和团队精神，较好的质量意识、文档编写能力。</span><br />\r\n</span>\r\n</p>\r\n<div>\r\n	<br />\r\n</div>\r\n<p>\r\n	<br />\r\n</p>\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\"></span><br />', '19', '0', '2015-07-23 08:47:14', '辰锦科技', '本站原创', '/upload/article/1507/201507230847139333.jpg', '0', '', '2', '0');
INSERT INTO `article` VALUES ('52', 'ios开发工程师', '江西南昌', '<p>\r\n	<span><span style=\"line-height:2;\">职位职责：</span><br />\r\n<span style=\"color:#666666;line-height:2;\">1.负责公司IOS平台移动应用产品独立开发；</span><br />\r\n<span style=\"color:#666666;line-height:2;\">2.负责根据项目需求编写分析设计文档和代码；</span><br />\r\n<span style=\"color:#666666;line-height:2;\">3.能够准确理解产品需求，按时完成产品目标。</span><br />\r\n<span style=\"line-height:2;\">职位要求：</span><br />\r\n<span style=\"color:#666666;line-height:2;\">1.具有的iOS开发经验至少1年以上；</span><br />\r\n<span style=\"color:#666666;line-height:2;\">2.具有扎实的计算机基础理论知识，对Mac系统有一定程度的了解；</span><br />\r\n<span style=\"color:#666666;line-height:2;\">3.熟悉iOS（iPhone/iPad）智能平台，对手机开发系统有全面的了解；</span><br />\r\n<span style=\"color:#666666;line-height:2;\">4.熟练掌握XCode的使用和Object-C语言，能够根据产品设计独立完成手机客户端应用及核心代码的编写；</span><br />\r\n<span style=\"color:#666666;line-height:2;\">5.性格开朗，责任心强，工作积极主动，具备强烈的进取心和良好的团队合作精神。</span><br />\r\n</span> \r\n</p>\r\n<div>\r\n</div>\r\n<p>\r\n	<br />\r\n</p>\r\n<span style=\"white-space:normal;color:#666666;line-height:2;\"></span>', '19', '0', '2015-07-23 08:47:35', '辰锦科技', '本站原创', '/upload/article/1507/201507230847331297.jpg', '0', '', '1', '0');
