INSERT INTO `product` VALUES ('9', '0', '趣约伴', '/upload/case/1507/201507271701596854.jpg', '', '0', '2015-01-29 11:20:06', '/upload/case/1502/201502261733246229.jpg|/upload/case/1502/201502261733246903.jpg|/upload/case/1502/201502261733251365.jpg|/upload/case/1502/201502261733276061.jpg|/upload/case/1502/201502261733281365.jpg|/upload/case/1502/201502261733316847.jpg|/upload/case/1502/201502261733311365.jpg|', '/upload/case/1502/201502261733016903.png', '/upload/case/1507/201507281052383157.png', '1', '1', '#00a0e6', '社交APP 活动APP 即时通信 群组聊天', '趣约伴，兴趣交友，是一款基于地理位置的活动类移动社交平台应用，为您量身打造充满趣味和热爱的城市生活，让我们一起参加自己喜爱的活动，寻找最合适你的朋友！通过趣约伴，能第一时间找到附近最好玩的活动，最热门的话题，可以无拘束的参加任何活动，同时还能随时随地自主举办一个活动，组建属于自己的圈子并邀请周围的人来参加。以相同的兴趣、共同的话题、好玩的活动为纽带，拉近彼此间的距离，让社交更真实。', '1002', '40', '1', 'https://itunes.apple.com/us/app/you-qu-yue-ban/id992715239?l=zh&amp;ls=1&amp;mt=8', 'http://app.chenjin.cc/youqu.apk ');
INSERT INTO `product` VALUES ('10', '0', '财大购物广场', '/upload/case/1503/201503311149483107.jpg', '', '0', '2015-01-29 11:25:16', '/upload/case/1503/201503301553321430.jpg|/upload/case/1503/201503301554595202.jpg|/upload/case/1503/201503301555384802.jpg|/upload/case/1503/201503301556136591.jpg|/upload/case/1503/201503301557122328.jpg|/upload/case/1503/201503301558442071.jpg|/upload/case/1503/201503301558505845.jpg|', '/upload/case/1501/201501291124424141.png', '/upload/case/1507/201507281054487318.png', '1', '1', '#ee4473', '电商APP 购物APP 财大购物广场 学生购物', '这是一款结合线上线下的电商类APP，可以直接在手机客户端端下订单、领红包，积分兑换、并且还可实现在线即时跟商家咨询。所有的商品都可以用二维码扫描进行获得该 商品的具体详情', '1439', '39', '1', 'https://itunes.apple.com/us/app/cai-gou/id996356852?l=zh&amp;ls=1&amp;mt=8', 'http://app.chenjin.cc/cg.apk ');
INSERT INTO `product` VALUES ('12', '0', '成长之家', '/upload/case/1502/201502141301259560.jpg', '', '1', '2015-01-29 11:28:56', '/upload/case/1503/201503301657408884.jpg|/upload/case/1503/201503301657453994.jpg|/upload/case/1503/201503301657553383.jpg|/upload/case/1503/201503301658015793.jpg|/upload/case/1503/201503301658132239.jpg|/upload/case/1503/201503301658179984.jpg|/upload/case/1503/201503301658207613.jpg|', '/upload/case/1502/201502261719573237.png', '/upload/case/1507/201507281111125366.png', '1', '1', '#f45724', '社交活动类APP 成长教育', '南昌成长之家是江西互动成长教育咨询有限公司旗下的一个产品。 主要是立志于为大学生打造一个休闲活动的平台，可以在其里面参与大学生活动，也可以自行创建活动和团队，还能及时聊天，打造成一体化休闲娱乐的大学生课后生活。我们帮其制作了成长之家手机APP。', '720', '29', '1', 'https://itunes.apple.com/us/app/cheng-zhang-zhi-jia/id919378811?mt=8', 'http://app.chenjin.cc/homegroup.apk');
INSERT INTO `product` VALUES ('13', '0', '北京奶豆', '/upload/case/1503/201503301156329313.jpg', '', '1', '2015-01-29 11:30:18', '/upload/case/1503/201503301456394877.jpg|/upload/case/1503/201503301457545564.jpg|/upload/case/1503/201503301458159146.jpg|/upload/case/1503/201503301528303552.jpg|/upload/case/1503/201503301529279842.jpg|/upload/case/1503/201503301530211958.jpg|/upload/case/1503/201503301532021951.jpg|', '/upload/case/1502/201502261703207601.png', '/upload/case/1507/201507281050317590.png', '1', '1', '#3ab6f2', '资讯APP 奶业APP 新闻资讯 奶业动态', '奶豆是辰锦科技为奶豆开发的一款定位于IT技术手段促进中国畜牧业的信息化发展，以养牛为立足点，以提供高效精准的“全方位营销传播服务”为使命，致力于将最前沿IT技术以快速度应用于传统行业，使得传统行业与新技术紧密结合，秉承“科技，让营销更有力”的运营理念，打造中国最具有营销穿透力的企业', '2387', '40', '1', 'https://itunes.apple.com/us/app/nai-dou/id960634999?l=zh&amp;ls=1&amp;mt=8', 'http://app.chenjin.cc/naidou.apk');
INSERT INTO `product` VALUES ('14', '0', '邀喝', '/upload/case/1503/201503301215074550.jpg', '', '1', '2015-01-29 11:32:22', '/upload/case/1503/201503301648453120.jpg|/upload/case/1503/201503301649358595.jpg|/upload/case/1503/201503301649458954.jpg|/upload/case/1503/201503301649558538.jpg|/upload/case/1503/201503301650065240.jpg|/upload/case/1503/201503301650099350.jpg|/upload/case/1503/201503301650141444.jpg|', '/upload/case/1502/201502261646246351.png', '/upload/case/1507/201507281106009764.png', '1', '1', '#5fb4b7', '社交APP 青春聚会 吃饭约饭', '邀喝客户端这是一款定位将陌生人喝酒、品茶、咖啡、饭局从线上约到线下交流的社区应用，此产品还汇聚本地优质供约会对象来选择，商家最新活动资讯也将实时在线发布，我们帮其制作手机客户端APP。', '1246', '32', '1', '', 'http://app.chenjin.cc/yaohe.apk');
INSERT INTO `product` VALUES ('15', '0', '商商网', '/upload/case/1503/201503301344213404.jpg', '', '1', '2015-01-29 11:33:43', '/upload/case/1502/201502261625288454.jpg|/upload/case/1502/201502261625335043.jpg|/upload/case/1502/201502261625371207.jpg|/upload/case/1502/201502261625412089.jpg|/upload/case/1502/201502261625451687.jpg|/upload/case/1502/201502261625498198.jpg|/upload/case/1502/201502261626454259.jpg|', '/upload/case/1601/201601071404039386.png', '/upload/case/1601/201601051439118068.jpg', '1', '1', '#fa7a1f', '行业APP 商商网 手机报价 移动互联网', '为中国移动江西地区及全国经销商提供业务交流、终端发布、信息资讯、休闲娱乐的综合平台。具有鲜明的行业风格，属全国首创。运营商、手机批发商、经销商、通讯从业人员通过这一平台实现无距离接触。信息共享，互惠互利。', '792', '27', '1', 'https://itunes.apple.com/cn/app/shang-shang-wang/id1030200460?l=en&amp;mt=8', 'http://app.chenjin.cc/base_signed_Aligned.encrypted (1)_signed_Aligned_signed_Aligned.apk');
INSERT INTO `product` VALUES ('16', '0', 'JOJO', '/upload/case/1503/201503301159155850.jpg', '', '1', '2015-01-29 11:34:29', '/upload/case/1503/201503301603399991.jpg|/upload/case/1503/201503301606433039.jpg|/upload/case/1503/201503301608559371.jpg|/upload/case/1503/201503301611445709.jpg|/upload/case/1503/201503301615215798.jpg|/upload/case/1503/201503301616021169.jpg|/upload/case/1503/201503301616425088.jpg|', '/upload/case/1502/201502261134413110.png', '/upload/case/1507/201507281057588601.png', '1', '1', '#e2373d', '社交APP 活动APP 青春聚会 活动召集', '这是一款结合线上线下的活动社交APP，网友下载后可以直接在APP中参加网友们发起的活动，可以在线发布活动，可以与网友们形成活动群组，让青春更疯狂。', '1774', '37', '1', 'https://itunes.apple.com/us/app/jo-jo/id966468250?l=zh&amp;ls=1&amp;mt=8', 'http://app.chenjin.cc/jojo.apk');
INSERT INTO `product` VALUES ('17', '0', 'i看师大', '/upload/case/1503/201503301212075844.jpg', '', '1', '2015-02-13 18:28:04', '/upload/case/1503/201503301541456111.jpg|/upload/case/1503/201503301543148114.jpg|/upload/case/1503/201503301544341893.jpg|/upload/case/1503/201503301546452890.jpg|/upload/case/1503/201503301547112470.jpg|/upload/case/1503/201503301547197078.jpg|/upload/case/1503/201503301547232205.jpg|', '/upload/case/1502/201502261228307023.png', '/upload/case/1507/201507281056416063.png', '1', '1', '#de3031', '资讯APP 校园APP 江西师范大学 校园印象', '江西师范大学第一个也是唯一一个专业校园摄影杂志APP，由师生采写，反映师生生活，向师生传播，以摄影为主要观察和表现方式，多维、深度、专注地反映江西师范大学深厚人文和美好生态，引导师生热爱校园热爱生活，是在校师生、离校校友、社会人士关注师大必备的掌上新媒体。', '1922', '38', '1', 'https://itunes.apple.com/us/app/i-kan-shi-da/id885695019?mt=8', 'http://app.chenjin.cc/isee_sd.apk');
INSERT INTO `product` VALUES ('18', '0', '编织圈', '/upload/case/1502/201502131834557561.jpg', '', '1', '2015-02-13 18:35:30', '/upload/case/1502/201502261616337376.jpg|/upload/case/1502/201502261616421390.jpg|/upload/case/1502/201502261616432400.jpg|/upload/case/1502/201502261616449317.jpg|/upload/case/1502/201502261616499879.jpg|/upload/case/1502/201502261616559069.jpg|/upload/case/1502/201502261617001418.jpg|', '/upload/case/1507/201507271553191541.png', '/upload/case/1507/201507281046448774.png', '1', '1', '#eb2153', '社交APP 在线教学APP 互动交友 编织教学', '编织圈是辰锦科技为编织圈开发的教学互动型APP，由编织小屋提供的大量编织新手入门的教程视频，让您简单上手进入编织的圈子。提供原创的毛衣、围巾、帽子、玩偶等成品的编织教程视频和图解，全部免费、不停更新！编织圈为你提供了更快速、漂亮、有趣的方式，记录和展现你热爱编织的一面，与志趣相投的朋友分享、交流。', '3342', '41', '1', 'https://itunes.apple.com/us/app/bian-zhi-quan/id983484652?l=zh&amp;ls=1&amp;mt=8', 'http://app.chenjin.cc/bianzhihouse.apk');
INSERT INTO `product` VALUES ('19', '0', '果优佳', '/upload/case/1502/201502131837005578.jpg', '', '1', '2015-02-13 18:37:16', '/upload/case/1503/201503301655375687.jpg|/upload/case/1503/201503301655426781.jpg|/upload/case/1503/201503301655453453.jpg|/upload/case/1503/201503301655582592.jpg|/upload/case/1503/201503301656021125.jpg|', '/upload/case/1502/201502261604528454.png', '/upload/case/1508/201508261544213669.png', '1', '1', '#34a400', '手机商城 水果O2O 手机网站', '南昌果优佳是目前南昌最大的进口水果网站之一。果优加是专注于水果进口，买卖，而且提供在线订购。我们帮其制作了手机网站，可以使其更好的让顾客方便、便捷的购买到自己喜爱的水果，做到真正的足不出户。', '1361', '31', '1', '', '');
INSERT INTO `product` VALUES ('20', '0', '聚活动', '/upload/case/1502/201502131837444757.jpg', '', '1', '2015-02-13 18:38:19', '/upload/case/1503/201503301634346120.jpg|/upload/case/1503/201503301634401648.jpg|/upload/case/1503/201503301634477190.jpg|/upload/case/1503/201503301634553781.jpg|/upload/case/1503/201503301635008244.jpg|/upload/case/1503/201503301635073672.jpg|/upload/case/1503/201503301635137784.jpg|', '/upload/case/1502/201502261553318575.png', '/upload/case/1507/201507281102257102.png', '1', '1', '#e76237', '社交APP 活动APP 青春聚会 活动召集', '聚活动是由南昌市辰锦网络科技有限公司开发，新浪江西信息技术有限公司联合运营的一个品牌产品，集合了城市吃喝玩乐等各方面活动资讯。1、内容全面，活动更新快。2、快速查找到区域附近的活动。3、品牌馆商家筛选出优质活动，可直接在线报名参加活动。4、参加报名的用户可推送特定的活动提醒。\r\n', '1357', '34', '1', 'https://itunes.apple.com/us/app/ju-huo-dong/id726944155?mt=8', 'http://app.chenjin.cc/juhd.apk');
INSERT INTO `product` VALUES ('21', '0', '碰爱', '/upload/case/1502/201502131838437433.jpg', '', '1', '2015-02-13 18:39:00', '/upload/case/1503/201503301701185566.jpg|/upload/case/1503/201503301701225020.jpg|/upload/case/1503/201503301701265080.jpg|/upload/case/1503/201503301701295678.jpg|/upload/case/1503/201503301701339604.jpg|/upload/case/1503/201503301701395349.jpg|/upload/case/1503/201503301701439625.jpg|', '/upload/case/1502/201502261305162527.png', '/upload/case/1507/201507281112476456.png', '1', '1', '#b55ae5', '电商APP ********APP', '妆点网（现隶属妆点科技旗下网络媒体平台）成立于2007年5月，是目前中国最大的互联网女性垂直门户网站之一。妆点是专注于向年轻时尚的女性群体提供包括无线互联网信息、网络广告以及女性商品在线订购的综合服务提供商。先后荣获“国内十佳购物网站”、“最受女性喜爱的门户网站”、“中国优秀女性传媒” “优秀区域垂直门户”“中国创新电子商务服务品牌”等称号。我们帮其制作了碰爱手机APP客户端', '802', '28', '1', '', 'http://app.chenjin.cc/pengai.apk');
INSERT INTO `product` VALUES ('22', '0', '双胞胎集团', '/upload/case/1502/201502131839244127.jpg', '', '1', '2015-02-13 18:39:39', '/upload/case/1503/201503310919315044.jpg|/upload/case/1503/201503310919348875.jpg|/upload/case/1503/201503310919377813.jpg|/upload/case/1503/20150    3310919461844.jpg|/upload/case/1503/201503310920133633.jpg|/upload/case/1503/201503310920506214.jpg|/upload/case/1503/201503310920591288.jpg|', '/upload/case/1502/201502261520589046.png', '/upload/case/1507/201507281109327533.png', '1', '1', '#b4100f', '手机网站 双胞胎集团猪价查询系统手机网站', '双胞胎集团是一家集饲料研发、生产、销售与技术咨询为一体的大型饲料集团，总部设在江西省南昌市。集团荣获“中国名牌产品”、“国家免检产品”、“全国三十强饲料企业”、“国家农业产业化龙头企业”等诸多殊荣。', '1258', '30', '1', '', '');
INSERT INTO `product` VALUES ('23', '0', '新浪陶瓷客', '/upload/case/1503/201503301346132259.jpg', '', '1', '2015-02-13 18:40:23', '/upload/case/1503/201503301618565612.jpg|/upload/case/1503/201503301620078318.jpg|/upload/case/1503/201503301622063440.jpg|/upload/case/1503/201503301622532804.jpg|/upload/case/1503/201503301624111968.jpg|/upload/case/1503/201503301625187015.jpg|/upload/case/1503/201503301625215707.jpg|', '/upload/case/1503/201503301630436313.png', '/upload/case/1507/201507281100119890.png', '1', '1', '#617fcf', '资讯APP 新浪陶瓷客 新闻资讯类APP', '新浪江西为满足大众对陶瓷艺术和陶瓷产品的需求，倾力打造江西省首个陶瓷电商的手机客户端——淘瓷客APP平台，通过该平台，景德镇众多大师以及大部分具有潜力的中青年艺术家的作品能够全方位、立体式向手机用户展示，同时景德镇千年的陶瓷艺术和全新创新也能随时随地供消费者查询，便于用户了解陶瓷行情，品味陶瓷文化，打造只属于自己的居家时尚风格。', '1381', '35', '1', 'https://itunes.apple.com/us/app/xin-lang-tao-ci-ke/id717584886?mt=8', 'http://app.chenjin.cc/china.apk');
INSERT INTO `product` VALUES ('24', '0', '南昌同仁堂', '/upload/case/1503/201503301342259339.jpg', '', '1', '2015-02-13 18:46:16', '/upload/case/1503/201503301636546310.jpg|/upload/case/1503/201503301638212892.jpg|/upload/case/1503/201503301639143541.jpg|/upload/case/1503/201503301642068981.jpg|/upload/case/1503/201503301642207418.jpg|/upload/case/1503/201503301642246185.jpg|/upload/case/1503/201503301642286557.jpg|', '/upload/case/1502/201502261317218816.png', '/upload/case/1507/201507281104196025.png', '1', '1', '#ac1c1b', '企业APP 资讯APP 北京同仁堂', '同仁堂是全国中药行业著名的老字号。创建于1669年（清康熙八年），自1723年开始供奉御药，历经八代皇帝188年。在300多年的风雨历程中，历代同仁堂人始终恪守&quot;炮制虽繁必不敢省人工，品味虽贵必不敢减物力&quot;的古训，树立&quot;修合无人见，存心有天知&quot;的自律意识，造就了制药过程中兢兢小心、精益求精的严细精神，其产品以&quot;配方独特、选料上乘、工艺精湛、疗效显著&quot;而享誉海内外，产品行销40多个国家和地区。', '1449', '33', '1', 'https://itunes.apple.com/us/app/tong-ren-tang-nan-chang-dian/id954179658?mt=8', 'http://app.chenjin.cc/tongrentang.apk');
INSERT INTO `product` VALUES ('25', '0', '淘喜网', '/upload/case/1507/201507011751406852.jpg', '', '0', '2015-07-01 17:52:02', '', '/upload/case/1507/201507271643202587.png', '/upload/case/1509/201509041352358430.png', '1', '1', ' ', '婚庆网站 行业网站', '淘囍网是一个立足南昌、辐射全国、深耕于婚庆行业的一站式结婚平台，在这里，你可以拍婚纱、选礼服、订酒店、买鲜花等等，各类结婚服务一站搞定。', '676', '24', '1', '', '');
