INSERT INTO `product` VALUES ('27', '0', '老果农', '/upload/case/1507/201507011758171463.jpg', '', '0', '2015-07-01 17:58:19', '/upload/case/1510/201510211103472746.png|/upload/case/1510/201510211104112431.png|/upload/case/1510/201510211104305383.png|/upload/case/1510/201510211104327786.png|/upload/case/1510/201510211104463611.png|/upload/case/1510/201510211104537035.png|/upload/case/1510/201510211104551387.png|', '/upload/case/1510/201510211107406777.png', '/upload/case/1509/201509041358306725.png', '1', '1', '#1d2532', '手机网站 网页设计 水果商城 老果农 微信定制开发', '老果农，专业水果网购品牌。汇聚全球鲜果，全程冷链，48小时退换货。优选进口水果、国产水果、精品水果礼盒', '779', '25', '1', '', '');
