INSERT INTO `product` VALUES ('31', '0', '中国售票网', '/upload/case/1604/201604181639118201.jpg', '', '1', '2016-03-04 11:25:16', '/upload/case/1604/201604161729393451.jpg|/upload/case/1604/201604161729564272.jpg|/upload/case/1604/201604161730125335.jpg|/upload/case/1604/201604161730291877.jpg|/upload/case/1604/201604161730468843.jpg|/upload/case/1604/201604161730597059.jpg|/upload/case/1604/201604161731132043.jpg|/upload/case/1604/201604161731277445.jpg|', '/upload/case/1603/201603041139235656.png', '/upload/case/1604/201604191027111138.jpg', '1', '1', 'rr', '售票', '中国售票网隶属于禾田文化传播有限公司旗下,以各类演出活动及体育比赛项目运作、策划和相关票务营销为主体的综合性网络,以丰富的演出活动为基础，强大的网络营销为保\r\n障,专业的服务体系为核心的票务销售平台。\r\n    系集网上票务查询、网上订购与按需配送为一体的专业化\r\n票务电子商务平台。秉承“准确、方便、快捷&quot;的服务宗旨,\r\n致力于互联网电子票务事业的发展,竭力为广大国内外消费者\r\n提供优质的一站式票务服务。\r\n\r\n', '674', '45', '1', 'http://fir.im/7dhw', 'http://59.63.169.49/cyf1990/tickets.apk');
